import time
import logging
import config
import json

logger = logging.getLogger("soca_logger")


def insert_default_projects():
    # Make sure this is called AFTER  insert_default_software_stacks
    logger.debug("Inserting default projects")
    if db.session.query(Projects).count() == 0:
        _software_stacks = db.session.query(SoftwareStacks).all()
        if not _software_stacks:
            logger.fatal(
                "Unable to insert default projects because no software stack exist, make sure insert_default_projects is called after insert_default_software_stacks"
            )
            exit(1)
        _default_project = Projects(
            created_by="SOCA_DEFAULT_INSTALLER",
            created_on=datetime.now(timezone.utc),
            project_name="default",
            is_active=True,
            description="Default Project, cannot be deleted",
            allowed_users="*",
            allowed_groups="*",
        )
        _default_project.software_stacks.extend(_software_stacks)

        db.session.add(_default_project)
        db.session.commit()


def insert_default_vdi_profile():
    logger.debug("Inserting default VDI Profile")
    if db.session.query(VirtualDesktopProfiles).count() == 0:
        _allowed_instances_pattern = config.Config.DCV_DEFAULT_AMI_INSTANCE_TYPES
        if (
            _result := ec2_helper.get_instance_types_by_architecture(
                instance_type_pattern=_allowed_instances_pattern
            )
        ).get("success") is False:
            logger.fatal(
                f"Unable to retrieve allowed instance types for {_allowed_instances_pattern} because of {_result.get('message')} , unable to insert default VDI profile"
            )
            exit(1)
        else:
            _allowed_instance_list = _result.get("message")

        db.session.add(
            VirtualDesktopProfiles(
                created_by="SOCA_DEFAULT_INSTALLER",
                created_on=datetime.now(timezone.utc),
                profile_name="default",
                is_active=True,
                pattern_allowed_instance_types=",".join(_allowed_instances_pattern),
                allowed_instance_types=json.dumps(_allowed_instance_list),
                allowed_subnet_ids=",".join(
                    SocaConfig(key="/configuration/PrivateSubnets")
                    .get_value(return_as=list)
                    .get("message")
                ),
                max_root_size=500,
            )
        )

        db.session.commit()


def insert_default_software_stacks():
    logger.debug("Inserting default DCV Software Stack in database")
    if db.session.query(SoftwareStacks).count() == 0:
        _defaults_ami = utils_remote_desktop_common.generate_default_dcv_amis()
        for _arch, _ami_info in _defaults_ami.items():
            for _base_os, _ami_id in _ami_info.items():
                try:
                    _label = f"{config.Config.DCV_BASE_OS.get(_base_os).get('friendly_name')}"
                except Exception as err:
                    logger.warning(
                        f"Unable to retrieve default friendly name for {_base_os} due to {err}. Edit config.Config.DCV_BASE_OS"
                    )
                    _label = f"{_base_os}"

                _visible = config.Config.DCV_BASE_OS.get(_base_os).get("visible", False)
                if _visible is False:
                    logger.warning(
                        f"Visible flag for {_base_os} in config.Config.DCV_BASE_OS is either False or missing"
                    )

                try:
                    _family = config.Config.DCV_BASE_OS.get(_base_os).get("family")
                except Exception as err:
                    logger.warning(
                        f"Unable to retrieve default family for {_base_os} due to {err}. Edit config.Config.DCV_BASE_OS, trying to determine by comparing base_os"
                    )
                    _family = "windows" if "windows" in _base_os.lower() else "linux"

                if "windows" in _base_os.lower():
                    _root_disk_size = 100
                else:
                    _root_disk_size = 40

                # Eventually move this out of DB, still lightweight
                if "amazonlinux" in _base_os.lower():
                    _base_64_encoded_img = "data:image/png;base64,"
                elif "rocky" in _base_os.lower():
                    _base_64_encoded_img = "data:image/png;base64,"
                elif "rhel" in _base_os:
                    _base_64_encoded_img = "data:image/png;base64,"
                elif "windows" in _base_os:
                    _base_64_encoded_img = "data:image/png;base64,"
                elif "ubuntu" in _base_os.lower():
                    _base_64_encoded_img = "data:image/png;base64,"
                else:
                    _base_64_encoded_img = "data:image/png;base64,"

                if _visible is True:
                    if _base_os == "windows2025":
                        _description = f"Default Windows Server 2025 image (Windows 11 Desktop style & appearance) with no additional software installed."
                    elif _base_os == "windows2022":
                        _description = f"Default Windows Server 2022 (Windows 10 Desktop style & appearance) image with no additional software installed."
                    elif _base_os == "windows2019":
                        _description = f"Default Windows Server 2019 (Windows 10 Desktop style & appearance) image with no additional software installed."
                    elif _base_os == "ubuntu2204":
                        _description = f"Default Ubuntu 22.04 (Jammy Jellyfish) image with no additional software installed."
                    elif _base_os == "ubuntu2404":
                        _description = f"Default Ubuntu 24.04 (Noble Numbat) image with no additional software installed."
                    elif _base_os == "rhel8":
                        _description = f"Default Red Hat Enterprise 8 image with no additional software installed."
                    elif _base_os == "rhel9":
                        _description = f"Default Red Hat Enterprise 9 image with no additional software installed."
                    elif _base_os == "rocky8":
                        _description = f"Default Rocky Linux 8 image with no additional software installed."
                    elif _base_os == "rocky9":
                        _description = f"Default Rocky Linux 9 image with no additional software installed."
                    elif _base_os == "amazonlinux2":
                        _description = f"Vanilla Amazon Linux 2 image with no additional software installed."
                    else:
                        _description = f"Default {_base_os} image with no additional software installed."

                    db.session.add(
                        SoftwareStacks(
                            ami_id=_ami_id,
                            ami_arch=_arch,
                            stack_name=_label,
                            ami_base_os=_base_os,
                            description=_description,
                            virtual_desktop_profile_id=1,
                            is_active=True,
                            ami_root_disk_size=_root_disk_size,
                            launch_tenancy="default",
                            launch_host=False,
                            created_on=datetime.now(timezone.utc),
                            created_by="SOCA_DEFAULT_INSTALLER",
                            thumbnail=_base_64_encoded_img,
                            os_family=_family,
                        )
                    )


